import React from "react";

export default class Library extends React.Component {
	constructor(props) {
		super(props);

		this.state = {
			restaurants: [],
		};
	}

	componentDidMount() {
		fetch(
			"https://my-json-server.typicode.com/landonsm/restaurants-api-final-project/restaurants"
		)
			.then((response) => {
				return response.json();
			})
			.then((json) => {
				console.log(json);
				this.setState({
					restaurants: json,
				});
			});
	}

	render() {
		return (
			<>
				<h3>My Library</h3>
				<h1>Help</h1>
				<table>
					<tr>
						<th>Name</th>
						<th>Composer</th>
						<th>Milliseconds</th>
					</tr>
					{this.state.tracks.map((data) => {
						return (
							<tr key={data.id}>
								<td>{data.attributes.name}</td>
								<td>
									{data.attributes.composer ? data.attributes.composer : "NA"}
								</td>
								<td>{data.attributes.milliseconds}</td>
							</tr>
						);
					})}
				</table>
			</>
		);
	}
}
